import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";
import Form from "react-bootstrap/Form";
import FormControl from "react-bootstrap/FormControl";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

const Footer = () => {
  return (
    <Navbar bg="transparent" fixed="sticky" expand="md">
      <Nav className="mr-auto">
        <Nav.Link href="/collections/new">New</Nav.Link>
        <Nav.Link href="#link">Tops</Nav.Link>
        <Nav.Link href="#link">Bottoms</Nav.Link>
        <Nav.Link href="#link">Accessories</Nav.Link>
        <Nav.Link href="#link">Bags</Nav.Link>
        <Nav.Link href="#link">Jewelry</Nav.Link>
      </Nav>
    </Navbar>
  );
};

export default Footer;
